import React from 'react';
import { connect } from 'react-redux';
import SearchBar from '../pictures/SearchBar';
import ImageList from '../pictures/ImageList';
// import { createStream } from '../../actions';
// import StreamForm from './StreamForm';

class StreamAddPic extends React.Component {
//looks as those this file is comprimised

  render() {
    return (
      <div>
          <SearchBar/>
          <ImageList onClick = {this.onClickPicture}/>
      </div>
    );
  }
}

export default connect(
  null,
)(StreamAddPic);
